import React from 'react';
import heart_card from '../assets/images/heart_card.svg';
import eye from '../assets/images/eye.svg';
import Wrapper from '../assets/wrappers/Card';
import background from '../assets/images/play_game.png';

const Card = ({ images }) => {
  {
    images.map((index, image) => {
      return (
        <Wrapper>
          <div
            key={index}
            className='card_box'
            style={{
              backgroundImage: `url(${image})`,
            }}
          >
            <div className='flex_top_card'>
              <span>-40%</span>
              <div>
                <img src={heart_card} />
              </div>
            </div>
            <div className='eye_card'>
              <img src={eye} />
            </div>
          </div>
        </Wrapper>
      );
    });
  }
};

export default Card;
